import React from 'react'
import backImg from '../../background_images/back-img.png'
import profPic from '../../background_images/profile_pic.png'
import profLink from '../../background_images/profile_linkd.png'
import './component2.css'
const Component2=(props)=>{
    return(
        <div className="block">
            <img className="profile_pic" src={profPic} alt="Img"/>
            <p className="profile_name">Shivansh Anand</p>
            <img className="profile_link" arc={profLink} alt="Img"/>
        </div>
    )
}
export default Component2;
